import React from "react";

import classes from "./Header.module.css";
import mealsImg from '../../assets/meals.jpg';

const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>ReactMeal</h1>
        <button>Your Cart</button>
      </header>
      <div >
        <img src={mealsImg} />
      </div>
    </React.Fragment>
  );
};

export default Header;
